import React from 'react';
import "../Asserts/Css/ComponentsCss/header.css";

const Header = () => {
    return (
        
           <ul>
            
            <li><img className='logo_img' src={IIEC_logo}></img></li>
            <li> <input className='header_inputs' placeholder='search' type= "text" /></li>
            <li>Event</li>
            <li>Find us</li>
            <li>Enquire</li>
            </ul>
         
    
    )}


export default Header ;
